import { createBrowserRouter, createRoutesFromElements, Route, Outlet, RouterProvider, ScrollRestoration } from "react-router-dom";

import Header from './components/assets/header/header.jsx';
import Footer from './components/assets/footer/footer.jsx';
import Main from './pages/main/main.jsx';
import About from './pages/about/about.jsx';
import NewsList from './pages/news/newslist/newslist.jsx';
import News from "./pages/news/news.jsx";

import "./styles/reset.css";
import "./styles/main.css";

/*const router = createBrowserRouter(
  createRoutesFromElements(
    <Route>
        <Route path="" element={<Header />} />
        <Route path="/" element={<Main />} />
        <Route path="about" element={<About />} />
        <Route path="newslist" element={<NewsList />} />
        <Route path="news" element={<News />} />
        <Route element={<Footer />} />
    </Route>
  )
);*/
function Layout() {
  return (
      <>
        <Header />
        <Outlet />
        <Footer />
      </>
  );
}

const router = createBrowserRouter([
  {
    element: <Layout/>,
    //errorElement: <ErrorPage />,
    children: [  
      {
        path: '/',
        element: <Main />
      },
      {
        path: '/about',
        element: <About />
      },
      {
        path: '/newslist',
        element: <NewsList />
      },
      {
        path: '/news',
        element: <News />
      }
    ]
  }
])

function App() {
  return (
    <div className="App">
        <RouterProvider router={router} />
    </div>
  );
}

export default App;
